					<hr className='w-25 bg-success rounded py-1 ui_gradient2 border-0 mt-n1 ml-md-0' />
					<div className='row'>
						<div className='container card-columns'>
							{this.props.results.map(project => {
								return (
									<ResultCard result={herb} getResult={this.props.getResult} />
								);
							})}
